import React from 'react'
import Pentagon from "../images/bg-triangle.svg";
import Paper from '../images/icon-paper.svg'
import Rock from '../images/icon-rock.svg'
import Scissors from '../images/icon-scissors.svg'
import  '../Style/Triangle.css'

function Triangle() {
  return (
    <div>
      <div className="triangle"> <img src={Pentagon}/></div>
      <div onClick={(e) =>console.log(e.target.className)}><img className="paper" src={Paper}/> </div>
      <div onClick={(e) =>console.log(e.target.className)}><img className="scissors" src={Scissors}/> </div>
      <div onClick={(e) =>console.log(e.target.className)}><img className="rock" src={Rock}/> </div>
    </div>
  )
}


const mapDispatchToProps = (dispatch) => {
  return {
    setUserChoice: (user) => dispatch({ type: "SET_USER", payload: { user } }),
  };
};

export default connect(null, mapDispatchToProps)(Triangle);
